import React from "react";
import LogIn from "./LogIn";
import image from "./Images/DogCat.jpeg";

function Home() {
  return (
    <div>
      <div className="pageCard row">
        <div className="pb-2 col-12 col-md-6">
          <h2 className="titleFont">Pet</h2>
          <h2 className="titleFont">Friend.ly</h2>

          <div className="bg-dark">
            <LogIn></LogIn>
          </div>
        </div>
        <div className="pb-2 col-12 col-md-6">
          <img src={image} alt=""></img>
        </div>
      </div>
    </div>
  );
}

export default Home;
